function f_gold(s, repeatLimit) {
    let cnt = new Array(26).fill(0);
    for (let i = 0; i < s.length; i++) {
        cnt[s.charCodeAt(i) - 'a'.charCodeAt(0)] += 1;
    }
    let ans = [];
    for (let i = 25; i >= 0; i--) {
        let j = i - 1;
        while (true) {
            for (let k = 0; k < Math.min(repeatLimit, cnt[i]); k++) {
                cnt[i] -= 1;
                ans.push(String.fromCharCode('a'.charCodeAt(0) + i));
            }
            if (cnt[i] == 0) {
                break;
            }
            while (j >= 0 && cnt[j] == 0) {
                j -= 1;
            }
            if (j < 0) {
                break;
            }
            cnt[j] -= 1;
            ans.push(String.fromCharCode('a'.charCodeAt(0) + j));
        }
    }
    return ans.join('');
}
